import React from 'react';
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';
import highchartsMap from "highcharts/modules/map";
import proj4 from "proj4";
import mapDataIE from "@highcharts/map-collection/countries/ie/ie-all.geo.json";

if (typeof window !== "undefined") {
  window.proj4 = window.proj4 || proj4;
}

  

class CoronoMap extends React.Component{

  constructor(props)
  {
    super();
    this.state = {
      options : {
        chart:{   
            height:320,
        },
        mapNavigation: {
          enabled: true
      },
      title: {
        text: props.presentRegion+' Map'
      },
      credits:{
          enabled:false
      },
      
      series: [
        {
          mapData: [],
          name: 'Map',
          data: []
        }
      ]
     }
    };

  }

    render(){
        return (
          <div className="col-xl-9 col-md-8">
              <div className="card" style={{marginBottom:'30px'}}>
                 <div className="card-body">
                    <HighchartsReact highcharts={Highcharts} options={this.state.options} constructorType={"mapChart"} />
                 </div>
              </div>
          </div>
        );
    }
}


export default CoronoMap;
